import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import ProfileSkills from './ProfileSkills'
import ProfileHeader from './ProfileHeader'
import WorkExperiences from './WorkExperiences'
import Education from './Education'
import Footer from './Footer'

class App extends Component {
  constructor(args) {
    super(args)
    this.userData = {
    }
  }

  render() {
    return (
      <div className="App">
      <div id="main-wrapper">
        <div className="columns-block container">
           <div className="left-col-block blocks">
              <header className="header theiaStickySidebar">
                 <div className="content">
                    <ProfileHeader profileData={this.userData.profile}/>
                    <ProfileSkills skills={this.userData.profile.skills} />
                 </div>
              </header>
           </div>
           <div className="right-col-block blocks">
              <div className="theiaStickySidebar">
                 <section className="section-wrapper section-interest gray-bg">
                    <div className="container-fluid">
                       <WorkExperiences experiences={this.userData.profile.experience}/>
                       <Education educations={this.userData.profile.education}/>
                    </div>
                 </section>
                 <Footer />
              </div>
           </div>
        </div>
      </div>
    </div>
    );
  }
}

export default App;
